import React from 'react'

const Producto = () => {
  return (
    <div className='col-sm-6 col-md-4'>
        <h4>Modelo</h4>
        <h5>Precio</h5>
        <button className='btn btn-dark'>Agregar</button>
    </div>
  )
}

export default Producto
